import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { CarFront, Flag, Timer, Trophy } from 'lucide-react';

const F1Predictor = () => {
  const [formData, setFormData] = useState({
    gridPosition: 1,
    q1Time: 80.00,
    q2Time: 0.00,
    q3Time: 0.00,
    teamPoints: 0,
    teamAvgPoints: 0.00,
    driverPoints: 0,
    recentAvgPosition: 10.00,
    constructor: 0,
    track: 0,
    laps: 50,
    raceRound: 1,
    trackExperience: 0,
    avgTrackPosition: 10.00
  });

  const [predictions, setPredictions] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const constructors = [
    "Mercedes", "Red Bull", "Ferrari", "McLaren", "Alpine",
    "AlphaTauri", "Aston Martin", "Williams", "Alfa Romeo", "Haas"
  ];

  const tracks = [
    "Bahrain", "Saudi Arabia", "Australia", "Azerbaijan", "Miami",
    "Monaco", "Spain", "Canada", "Austria", "Britain", "Hungary",
    "Belgium", "Netherlands", "Italy", "Singapore", "Japan",
    "Qatar", "USA", "Mexico", "Brazil", "Vegas", "Abu Dhabi"
  ];

  const handleChange = (name, value) => {
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async () => {
    setLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:5000/api/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          ...formData,
          BestQualiTime: Math.min(...[formData.q1Time, formData.q2Time, formData.q3Time].filter(t => t > 0)),
          PositionsGained: 0,
          year: new Date().getFullYear(),
          Constructor_encoded: formData.constructor,
          raceName_encoded: formData.track,
          Points: formData.driverPoints,
          TeamSeasonPoints: formData.teamPoints,
          TeamAvgPoints: formData.teamAvgPoints,
          RecentAvgPosition: formData.recentAvgPosition,
          TrackExperience: formData.trackExperience,
          AvgTrackPosition: formData.avgTrackPosition
        })
      });

      if (!response.ok) {
        throw new Error('Failed to get predictions');
      }

      const data = await response.json();
      setPredictions(data);
    } catch (err) {
      setError(err.message);
      console.error('Error:', err);
    } finally {
      setLoading(false);
    }
  };

  const PredictionCard = ({ title, probability }) => (
    <div className="bg-white/10 backdrop-blur-lg rounded-xl p-6 transition-all duration-300 hover:transform hover:scale-105">
      <h3 className="text-lg font-semibold mb-4">{title}</h3>
      <div className="relative pt-1">
        <div className="overflow-hidden h-6 text-xs flex rounded-full bg-white/20">
          <div
            style={{ width: `${probability * 100}%` }}
            className="shadow-none flex flex-col text-center whitespace-nowrap text-white justify-center bg-f1-red transition-all duration-1000 ease-out"
          />
        </div>
        <div className="text-right mt-2">
          <span className="text-2xl font-bold">{(probability * 100).toFixed(1)}%</span>
        </div>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-gray-800 to-black text-white p-8">
      <div className="max-w-7xl mx-auto space-y-8">
        {/* Header */}
        <div className="text-center space-y-4">
          <h1 className="text-5xl font-bold flex items-center justify-center gap-4">
            <CarFront className="h-12 w-12 text-f1-red" />
            Formula 1 Race Predictor
          </h1>
          <p className="text-xl text-gray-400">Enter race information to predict outcomes</p>
        </div>

        {/* Main Form Grid */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {/* Qualifying Section */}
          <div className="bg-white/5 rounded-xl p-6 backdrop-blur-sm border border-white/10">
            <div className="flex items-center gap-3 mb-6">
              <Timer className="h-6 w-6 text-f1-red" />
              <h2 className="text-2xl font-bold">Qualifying</h2>
            </div>

            <div className="space-y-4">
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Grid Position
                </label>
                <div className="relative">
                  <input
                    type="number"
                    value={formData.gridPosition}
                    onChange={(e) => handleChange('gridPosition', Number(e.target.value))}
                    className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                    min="1"
                    max="20"
                  />
                </div>
              </div>

              {/* Q1 Time */}
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Q1 Time (seconds)
                </label>
                <input
                  type="number"
                  value={formData.q1Time}
                  onChange={(e) => handleChange('q1Time', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                  step="0.001"
                />
              </div>

              {/* Q2 Time */}
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Q2 Time (seconds)
                </label>
                <input
                  type="number"
                  value={formData.q2Time}
                  onChange={(e) => handleChange('q2Time', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                  step="0.001"
                />
              </div>

              {/* Q3 Time */}
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Q3 Time (seconds)
                </label>
                <input
                  type="number"
                  value={formData.q3Time}
                  onChange={(e) => handleChange('q3Time', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                  step="0.001"
                />
              </div>
            </div>
          </div>

          {/* Team Performance */}
          <div className="bg-white/5 rounded-xl p-6 backdrop-blur-sm border border-white/10">
            <div className="flex items-center gap-3 mb-6">
              <Trophy className="h-6 w-6 text-f1-red" />
              <h2 className="text-2xl font-bold">Team Performance</h2>
            </div>

            <div className="space-y-4">
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Constructor
                </label>
                <select
                  value={formData.constructor}
                  onChange={(e) => handleChange('constructor', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                >
                  {constructors.map((team, index) => (
                    <option key={team} value={index}>{team}</option>
                  ))}
                </select>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Team Points
                </label>
                <input
                  type="number"
                  value={formData.teamPoints}
                  onChange={(e) => handleChange('teamPoints', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Average Points
                </label>
                <input
                  type="number"
                  value={formData.teamAvgPoints}
                  onChange={(e) => handleChange('teamAvgPoints', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                  step="0.1"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Driver Points
                </label>
                <input
                  type="number"
                  value={formData.driverPoints}
                  onChange={(e) => handleChange('driverPoints', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                />
              </div>
            </div>
          </div>

          {/* Race Information */}
          <div className="bg-white/5 rounded-xl p-6 backdrop-blur-sm border border-white/10">
            <div className="flex items-center gap-3 mb-6">
              <Flag className="h-6 w-6 text-f1-red" />
              <h2 className="text-2xl font-bold">Race Information</h2>
            </div>

            <div className="space-y-4">
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Track
                </label>
                <select
                  value={formData.track}
                  onChange={(e) => handleChange('track', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                >
                  {tracks.map((track, index) => (
                    <option key={track} value={index}>{track}</option>
                  ))}
                </select>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Race Laps
                </label>
                <input
                  type="number"
                  value={formData.laps}
                  onChange={(e) => handleChange('laps', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Race Round
                </label>
                <input
                  type="number"
                  value={formData.raceRound}
                  onChange={(e) => handleChange('raceRound', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Recent Average Position
                </label>
                <input
                  type="number"
                  value={formData.recentAvgPosition}
                  onChange={(e) => handleChange('recentAvgPosition', Number(e.target.value))}
                  className="w-full bg-white/10 border border-white/20 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-f1-red focus:border-transparent"
                  step="0.1"
                />
              </div>
            </div>
          </div>
        </div>

        {/* Submit Button */}
        <div className="flex justify-center">
          <button
            onClick={handleSubmit}
            disabled={loading}
            className="bg-f1-red hover:bg-red-700 text-white font-bold py-4 px-8 rounded-lg transform transition-all duration-200 hover:scale-105 disabled:opacity-50 disabled:cursor-not-allowed"
          >
            {loading ? 'Calculating...' : 'Make Predictions'}
          </button>
        </div>

        {/* Error Display */}
        {error && (
          <div className="bg-red-900/50 border border-red-500 text-white px-4 py-3 rounded relative" role="alert">
            <strong className="font-bold">Error: </strong>
            <span className="block sm:inline">{error}</span>
          </div>
        )}

        {/* Predictions Display */}
        {predictions && (
          <div className="mt-12 space-y-6">
            <h2 className="text-3xl font-bold text-center mb-8">Race Predictions</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6"></div>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
              {Object.entries(predictions).map(([outcome, probability]) => (
                <PredictionCard
                  key={outcome}
                  title={outcome}
                  probability={probability}
                />
              ))}
            </div>

            {/* Prediction Summary */}
            <div className="mt-8 bg-white/5 rounded-xl p-6 backdrop-blur-sm border border-white/10">
              <h3 className="text-2xl font-bold mb-4">Summary</h3>
              <div className="space-y-2">
                {Object.entries(predictions)
                  .sort(([, a], [, b]) => b - a)
                  .map(([outcome, probability]) => (
                    <div key={outcome} className="flex justify-between items-center">
                      <span className="text-gray-300">{outcome}:</span>
                      <span className="font-bold">{(probability * 100).toFixed(1)}%</span>
                    </div>
                  ))}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default F1Predictor;
